import { LIST_LOADED } from "../common/types";

export const loadList = () => async (dispatch: any) => {
  try {
    dispatch({
      type: LIST_LOADED,
      payload: [
          {
              id:0,
              name: "zrobic kupe",
              checked: false,
          },
          {
            id:1,
            name: "zrobic kupe",
            checked: false,
        },
        {
          id:0,
          name: "zrobic kupe",
          checked: false,
      },
      ],
    });
  } catch (err) {
      console.log(`err`, err)
  }
};
